  `CustomerID` int NOT NULL,
  `VehicleID` int NOT NULL,
  `WorkerID` int NOT NULL,
  `PaymentsID` int NOT NULL,
  `DepartmentDate` datetime NOT NULL,
  PRIMARY KEY (`OrderID`),
  UNIQUE KEY `OrderID_UNIQUE` (`OrderID`),
  KEY `FN_Warehouse_idx` (`WarehouseID`),
